const state_stack = [];

$(window).on('load', () => {
    const params = new URLSearchParams(window.location.search);
    const CANDIDATE_NUM = parseInt(params.get('size') || '15');
    const TOP_NUM = parseInt(params.get('top') || '15');

    function iter(data, $anchor) {
        $anchor.empty();

        $anchor.append($(`<p>>${data.size}/${ALL_MY_MUSIC.size}</p>`));

        $('<button>', {
            type: "button",
            text: "Back up"
        })
            .appendTo($anchor)
            .on('click', () => {
            if (state_stack.length === 0) {
                alert('NO WAY BACK');
                return;
            }

            let last_state = state_stack.pop();
            let newly_added_num = last_state[1].size;
            iter(last_state[0].concat(data.take(data.size - newly_added_num)), $anchor);
        });

        if (data.size <= TOP_NUM) {
            data.forEach(final => $('<p>').text(final).appendTo($anchor));
            return;
        }

        let candidates = data.take(CANDIDATE_NUM);
        let container = $('<div>', { id: 'container' }).appendTo($anchor);

        candidates.forEach((cand, i) => {
            $('<input>', {
                type: 'checkbox',
                id: `fav${i}`,
                value: cand,
                class: 'candidate'
            }).appendTo(container);

            let search = $('<a>', {
                target: '_blank',
                text: 'Search YouTube',
                href: `https://www.youtube.com/results?search_query=${cand}`
            });
            search = $('<span>').append(search);

            $('<label>', {
                for: `fav${i}`,
                text: cand
            })
                .appendTo(container)
                .append(search);

            $('<br>').appendTo(container);
        });

        $('<button>', {
            type: "button"
        })
            .text('Done')
            .appendTo($anchor)
            .on('click', () => {
                let checked = Immutable.List($('.candidate:checked').toArray().map(e => $(e).val()));
                let this_round_selected = checked.size;
                state_stack.push([candidates, checked]);
                iter(data.skip(CANDIDATE_NUM).concat(checked), $anchor);
            });

        $('<button>', {
            type: "button"
        })
            .text('Check All')
            .appendTo($anchor)
            .on('click', () => {
                $('.candidate:checkbox').prop('checked', !$(this).is(':checked'));
            });
    }

    iter(ALL_MY_MUSIC, $('#my-fav'));
});
